import './App.css';
import React from 'react'
import  Sidebar from './components/Sidebar';
import  Feed from './components/Feed';
import  Rightbar from './components/Rightbar';
import { Container } from '@mui/material';


function App() {



  return (

  <Container>
    <Stack direction="row" spacing={2}>
    <Sidebar />
    <Feed />
    <Rightbar />
    </Stack>
    </Container>



  ); 
}


export default App;
